import styled from "styled-components";




export const Home_Contact_Section = styled.section`
  width: 100%;
  margin: auto;
  display: grid;
  height: 600px;
  background-color: black;
`;

export const Home_Contact_Wrapper = styled.div`
  grid-template-columns: 1fr 2fr;
  align-items: center;
  justify-content: center;
  width: 1280px;
  margin: auto;

`;

export const Home_Contact_Small_Contact = styled.div`

height: 100%;
  width: 100%;
`;

export const Home_Contact_Call_To_Action = styled.div`
width: 431px;
`;
